        ? '.hotel-list .hotel-list__item:first-of-type [data-cy="hotel-tile"] [data-cy="hotel-tile-info"]'
        : `.hotel-list .hotel-list__item:nth-of-type(${this.currentHotelListItem}) [data-cy="hotel-tile"] [data-cy="hotel-tile-info"]`
    );
    hotel.click();
    this.selectAndGetElement('.hotel-details__nav-bar');
  }

  preloadHotelTile() {
    this.getElementAndScrollIntoView(
      this.currentHotelListItem === 1
        ? '.hotel-list .hotel-list__item:first-of-type [data-cy="hotel-tile"]'
        : `.hotel-list .hotel-list__item:nth-of-type(${this.currentHotelListItem}) [data-cy="hotel-tile"]`
    );
  }

  vacancyCheck() {
    this.currentHotelListItem = 1;

    for (let hI = 1; hI < 4; hI++) {
      const haveMinOneVacancyAtOffersList = this.checkVacancyStackOfHotel();
      if (haveMinOneVacancyAtOffersList) {
        break;
      }

      this.navigateBackAndChooseNextHotel();

      if (hI === 3 && !haveMinOneVacancyAtOffersList) {
        assert.fail('no bookable vacancies found at the first three hotels');
      }
    }
  }

  navigateBackAndChooseNextHotel() {
    browser.back();
    this.currentHotelListItem++;
    this.preloadHotelTile();
    this.chooseAHotel();
  }

  checkVacancyStackOfHotel() {
    for (let i = 1; i < 7; i++) {
      const hasSuccessVacancy = this.checkSingleVacancy(i);
      if (hasSuccessVacancy) {
        return true;
      }

      if (i === 6 && !hasSuccessVacancy) {
        return false;
      }
    }
